with base as(select d.distribution_file_id,
                    d.description,
                    d.file_name,
                    d.file_version,
                    d.version_number,
                    d.md5_hash,
                    d.distri_group_id
from ge_distribution_file d
order by upper(d.file_name)
)   
   SELECT XMLAGG(
   XMLELEMENT("DistributionFile",
         XMLELEMENT("DistributionFileId", e.distribution_file_id),
         XMLELEMENT("Description", e.description),
         XMLELEMENT("FileVersion", e.file_version),
         XMLELEMENT("VersionNumber", e.version_number),
         XMLELEMENT("FileName", e.file_name),
         XMLELEMENT("Md5Hash", e.md5_hash),
         XMLELEMENT("DistrGroupId", e.distri_group_id)
       )) AS dist
FROM   base e;


